ure by empowering the nobility and limiting the emperor’s authority. Despite efforts at centralization, the Habsburgs’ attempts at reform only temporarily strengthened the empire before it crumbled under external pressures. Finally, after centuries of division, the fall of the Holy Roman Empire in 1806 marked the end of an era. \n\nWhy Was Italy so Fragmented in the Middle Ages?: https://youtu.be/L9m5kifZjhU\n\nSupport us on Patreon: http://www.patreon.com/KingsandGenerals or Paypal: http://paypal.me/kingsandgenerals or by joining the youtube membership: https://www.youtube.com/channel/UCMmaBzfCCwZ2KqaBJjkj0fw/join We are grateful to our patrons and sponsors, who made this video possible: https://docs.google.com/document/d/1ooKPbpq0z8ciEjz5Zmrga4-gWRmripm0u4BHMkkXHVc/edit?usp=sharing\n\nThe video was made by Sebastiao Reis, while the script was developed by Hleb L, the video was narrated by Officially Devin (https://www.youtube.com/channel/UCU0-VII-V376zFxiRGMeZGg \u0026 https://www.youtube.com/channel/UC79s7EdN9uXX77-Ly2HmEjQ)\n\n✔ Merch store ► https://teespring.com/stores/kingsandgenerals\n✔ Patreon ► https://www.patreon.com/KingsandGenerals\n✔ Podcast ► http://www.kingsandgenerals.net/podcast/\n✔ PayPal ► http://paypal.me/kingsandgenerals\n✔ Twitter ► https://twitter.com/KingsGenerals\n✔ Facebook ► https://www.facebook.com/KingsGenerals\n✔ Instagram ►http://www.instagram.com/Kings_Generals\n\nProduction Music courtesy of Epidemic Sound: http://www.epidemicsound.com\n\nSources: https://docs.google.com/document/d/1TRIL9o4OXJH4FXwy6R6NpCSLOKBomIiwj7-AEJ6Mh6A/edit?usp=sharing\n\n00:00 - The Holy Roman Empire: A Mess of Borders\n02:06 - The Rise of Feudalism and Fragmentation\n07:02 - The Struggle for Power: Papacy vs. Emperor\n12:00 - The Golden Bull and the Rise of Nobility\n15:37 - The Habsburgs’ Attempts at Reform\n18:07 - The Fall of the Holy Roman Empire\n\n#documentary #Germany #HolyRomanEmpire"},"lengthSeconds":"1180","ownerProfileUrl":"http://www.youtube.com  we explore why it stayed decentralized and how feudalism played a key role in its rise and fragmentation. A major factor in its political struggles was the power struggle between the Papacy and the Emperor, which led to conflicts like the Investiture Controversy. Meanwhile, the Golden Bull of 1356 formalized the empire’s fragmented structure by empowering the nobility and limiting the emperor’s authority. Despite efforts at centralization, the Habsburgs’ attempts at reform only temporarily strengthened the empire before it crumbled under external pressures. Finally, after centuries of division, the fall of the Holy Roman Empire in 1806 marked the end of an era. \n\nWhy Was Italy so Fragmented in the Middle Ages?:    • Why Was Italy so Fragmented in the Middle ...  \n\nSupport us on Patreon:   / kingsandgenerals   or Paypal: http://paypal.me/kingsandgenerals or by joining the youtube membership:    / @kingsandgenerals   We are grateful to our patrons and sponsors, who made this video possible: https://docs.google.com/document/d/1o...\n\nThe video was made by Sebastiao Reis, while the script was developed by Hleb L, the video was narrated by Officially Devin (   / @offydgg   \u0026    / @gameworldnarratives  )\n\n✔ Merch store ► https://teespring.com/stores/kingsand...\n✔ Patreon ►   / kingsandgenerals  \n✔ Podcast ► http://www.kingsandgenerals.net/podcast/\n✔ PayPal ► http://paypal.me/kingsandgenerals\n✔ Twitter ►   / kingsgenerals  \n✔ Facebook ►   / kingsgenerals  \n✔ Instagram ►  / kings_generals  \n\nProduction Music courtesy of Epidemic Sound: http://www.epidemicsound.com\n\nSources: https://docs.google.com/document/d/1T...\n\n00:00 - The Holy Roman Empire: A Mess of Borders\n02:06 - The Rise of Feudalism and Fragmentation\n07:02 - The Struggle for Power: Papacy vs. Emperor\n12:00 - The Golden Bull and the Rise of Nobility\n15:37 - The Habsburgs’ Attempts at Reform\n18:07 - The Fall of the Holy Roman Empire\n\n#documentary #Germany #HolyRomanEmpire","commandRun "text":"Показані тут пропозиції підібрано на основі товарів, які згадуються у відео, що ви дивитеся, Колекцій товарів або з урахуванням ваших минулих дій після входу в обліковий запис YouTube (зокрема пов’язаних товарів або позицій, які ви шукали чи які згадуються в роликах). ","textColor":4294967295},{"text":"Докладніше","navigationEndpoint":{"clickTrackingParams":"CK4EEMdVIhMIrNGwg6aKjwMVwsFCBR0ZawBq","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}},{"text":"\n\nПродавці надають дані про товари й остаточну ціну, а також можуть змінювати таку інформацію. З вас може стягуватися додаткова плата (наприклад, за доставку й обробку замовлення), яка може відрізнятися залежно від продавця. Натисніть товар нижче або перейдіть на його сторінку в магазині продавця, щоб отримати докладнішу інформацію (зокрема про наявність і ціну товару) та зробити покупку. Ціни вказано з урахуванням ПДВ (якщо застосовується).\n\nЯкщо товар має позначку \"ексклюзивно на каналі\", значить продавець розмістив його лише на цьому конкретному каналі YouTube. Знижки й наявність таких товарів залежать від умов роботи продавця. Остаточну ціну й умови для покупки визначає сам продавець. ","textColor":4294967295},{"text":"Докладніше","navigationEndpoint":{"clickTrackingParams":"CK4EEMdVIhMIrNGwg6aKjwMVwsFCBR0ZawBq","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}},{"text":"\n\nYouTube не несе відповідальності за товари, які пропонують продавці, а також за достовірність даних про них. YouTube також не несе відповідальності за дії і покупки, здійснені в магазинах цих продавців (зокрема коли ви переходите за наведеними нижче посиланнями). Такі дії і покупки регулюються умовами використання й політикою конфіденційності продавців. Відгуки про товари доступні лише в деяких країнах або регіонах, і Google їх не перевіряє. ","textColor":4294967295},{"text":"Докладніше","navigationEndpoint":{"clickTrackingParams":"CK4EEMdVIhMIrNGwg6aKjwMVwsFCBR0ZawBq","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/googleshopping/answer/9370999?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/googleshopping/answer/9370999?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}}]},"confirmLabel":{"simpleText":"OK"},"trackingParams":"CK4EEMdVIhMIrNGwg6aKjwMVwsFCBR0ZawBq"}},"popupType":"DIALOG"}},"trackingParams":"CKwEEJT0ARgDIhMIrNGwg6aKjwMVwsFCBR0ZawBq"}},{"menuServiceItemRenderer":{"text":{"accessibility":{"accessibilityData":{"label":"Поскаржитися на пропозицію"}},"simpleText":"Поскаржитися на пропозицію"},"icon":{"iconType":"FLAG"},"serviceEndpoint":{"clickTrackingParams":"CK0EENbYBxgfIhMIrNGwg6aKjwMVwsFCBR0ZawBq","commandMetadata":{"webCommandMetadata":{"sendPost":true,"apiUrl":"/youtubei/v1/flag/get_form"}},"getReportFormEndpoint":{"params":"ygEIc2hvcHBpbmfQAQ7iAfgxCr0BClAKCAoGU3ByaW5nCgMKASwKAwoBIAoiCiBTUFFSIDIgQ2xhc3NpYyBDcmV3IE5lY2sgVC1TaGlydAoDCgEsCgMKASAKDAoKMjEsMzfCoEVVUhppQm03SWlBQUFBQUFDQWdJQ3dEd0FBQWNDTnR3RUFJQUE0QVlJQkVIbHZkWFIxWW1VdGMyaHZjSEJwYm1leUFSTjViM1YwZFdKbExYTm9iM0J3YVc1bkxURnc0QktFNk1iaTI5TDZyZG9CCt4BCnEKCAoGU3ByaW5nCgMKASwKAwoBIApDCkFBbGVhIElhY3RhIEVzdCBOZXh0IExldmVsIDM2MDAgfCBQcmVtaXVtIFJpbmctU3B1biBDb3R0b24gVC1TaGlydAoDCgEsCgMKASAKDAoKMjUsNjXCoEVVUhppQmpkNzBBQUFBQUFDQWdJQ3dEd0FBQWNDTnR3RUFJQUE0QVlJQkVIbHZkWFIxWW1VdGMyaHZjSEJwYm1leUFSTjViM1YwZFdKbExYTm9iM0J3YVc1bkxURnc0Qkx6dHVPeDVPN1Z5TGdCCt0BCnEKCAoGU3ByaW5nCgMKASwKAwoBIApDCkFBbGVhIElhY3RhIEVzdCBOZXh0IExldmVsIDM2MDAgfCBQcmVtaXVtIFJpbmctU3B1biBDb3R0b24gVC1TaGlydAoDCgEsCgM ацію (зокрема про наявність і ціну товару) та зробити покупку. Ціни вказано з урахуванням ПДВ (якщо застосовується).\n\nЯкщо товар має позначку \"ексклюзивно на каналі\", значить продавець розмістив його лише на цьому конкретному каналі YouTube. Знижки й наявність таких товарів залежать від умов роботи продавця. Остаточну ціну й умови для покупки визначає сам продавець. ","textColor":4294967295},{"text":"Докладніше","navigationEndpoint":{"clickTrackingParams":"CIsBEMdVIhMIrNGwg6aKjwMVwsFCBR0ZawBq","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/youtube/answer/12257682?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}},{"text":"\n\nYouTube не несе відповідальності за товари, які пропонують продавці, а також за достовірність даних про них. YouTube також не несе відповідальності за дії і покупки, здійснені в магазинах цих продавців (зокрема коли ви переходите за наведеними нижче посиланнями). Такі дії і покупки регулюються умовами використання й політикою конфіденційності продавців. Відгуки про товари доступні лише в деяких країнах або регіонах, і Google їх не перевіряє. ","textColor":4294967295},{"text":"Докладніше","navigationEndpoint":{"clickTrackingParams":"CIsBEMdVIhMIrNGwg6aKjwMVwsFCBR0ZawBq","commandMetadata":{"webCommandMetadata":{"url":"https://support.google.com/googleshopping/answer/9370999?nohelpkit=1","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://support.google.com/googleshopping/answer/9370999?nohelpkit=1","target":"TARGET_NEW_WINDOW"}}}]},"confirmLabel":{"simpleText":"OK"},"trackingParams":"CIsBEMdVIhMIrNGwg6aKjwMVwsFCBR0ZawBq"}},"popupType":"DIALOG"}},"trackingParams":"CE0Qw9AHGAAiEwis0bCDpoqPAxXCwUIFHRlrAGo="}},{"menuServiceItemRenderer":{"text":{"accessibility":{"accessibilityData":{"label":"Поскаржитися на пропозицію"}},"simpleText":"Поскаржитися на про азати менше"},"attributedDescriptionBodyText":{"content":"Go to my sponsor https://aura.com/kings to get a 14-day free trial and start protecting your data — because if you don’t, who will?\n\nKings and Generals animated historical documentary series on the Middle Ages continues with an episode on history of Germany and Europe. The Holy Roman Empire was one of history’s most complex and fragmented political entities. A chaotic mix of states, its borders remained a mess for centuries. In this video, we explore why it stayed decentralized and how feudalism played a key role in its rise and fragmentation. A major factor in its political struggles was the power struggle between the Papacy and the Emperor, which led to conflicts like the Investiture Controversy. Meanwhile, the Golden Bull of 1356 formalized the empire’s fragmented structure by empowering the nobility and limiting the emperor’s authority. Despite efforts at centralization, the Habsburgs’ attempts at reform only temporarily strengthened the empire before it crumbled under external pressures. Finally, after centuries of division, the fall of the Holy Roman Empire in 1806 marked the end of an era. \n\nWhy Was Italy so Fragmented in the Middle Ages?:    • Why Was Italy so Fragmented in the Middle ...  \n\nSupport us on Patreon:   / kingsandgenerals   or Paypal: http://paypal.me/kingsandgenerals or by joining the youtube membership:    / @kingsandgenerals   We are grateful to our patrons and sponsors, who made this video possible: https://docs.google.com/document/d/1o...\n\nThe video was made by Sebastiao Reis, while the script was developed by Hleb L, the video was narrated by Officially Devin (   / @offydgg   \u0026    / @gameworldnarratives  )\n\n✔ Merch store ► https://teespring.com/stores/kingsand...\n✔ Patreon ►   / kingsandgenerals  \n✔ Podcast ► http://www.kingsandgenerals.net/podcast/\n✔ PayPal ► http://paypal.me/kingsandgenerals\n✔ Twitter ►   / kingsgenerals  \n✔ Facebook ►   / kingsgenerals  \n✔ In
